import numpy as np
from itertools import permutations

def shortest(r, s):
  best = list((s, 1000))
  #print(best)
  city = set()
  a = set()
  b = set()
  city_info = []
  city1 = []
  new_tour = list(range(24))
  cost = 0
  p = 1100

  for x in range(len(r)):
    city.add(r[x][0])

  city = list(city)

  for y in city:
    a = np.where((y == r[:, 0]), r[:, 1], 0)
    b = np.where((y == r[:, 1]), r[:, 0], 0)
    city_info.append(y)
    k = np.concatenate((a, b))
    k = set(k.flatten())
    k.remove('0')
    k = list(k)
    city_info.append(k)

  city_info = np.reshape(city_info, (5, 2))
  city.remove(s)
  tour = permutations(city)
  tour = list(tour)

  for t in range(len(tour)):
    tour[t] = list(tour[t])
    tour[t].insert(0, 'A')
    tour[t].insert(5, 'A')

    if p < best[1]:
      best[1] = p

    p = 0
    best_tour = tour[t-1]
    #print(best[1], tour[t-1])
    #print('-------------------')

    for j in range(len(city)+1):
      m = np.extract((tour[t][j] == r[:, 0]) & (tour[t][j+1] == r[:, 1]), r[:, 2])
      n = np.extract((tour[t][j] == r[:, 1]) & (tour[t][j+1] == r[:, 0]), r[:, 2])
      m_n = np.concatenate((m, n))
      p += int(m_n[0])
      #print(p)
      
      if p <= best[1]:
        pass
      else:
        break

  return best[1], best_tour
    
route = np.array([['A', 'B', 2], 
                  ['B', 'C', 3], 
                  ['C', 'D', 6], 
                  ['D', 'E', 9], 
                  ['E', 'A', 10], 
                  ['C', 'E', 1], 
                  ['A', 'C', 7], 
                  ['B', 'D', 5], 
                  ['A', 'D', 3], 
                  ['B', 'E', 4]])
start = 'A'
z = shortest(route, start)
print(z)

